import React, { Component } from "react";
import "./articles.css"

export default class Articles extends Component{
    constructor(props){
        super(props);
        this.state = {
            resume : false
        }
    }

    render() {
        for(let i = 0; i < 5; i++) {
            return (
                <div id="articles">
                    <div id="article">
                        <p id="article__title">Titre de la location</p>
                    </div>
                </div>
                )        
        }
    }
}
